// Overview.js

import React from "react";

function Overview(props) {
    const { cards } = props;
    return (
        <div>
            {cards.map((card) => {
                return <div>
                    <img src={'../image.jpg'}></img>
                    </div>;
              })}
        </div>
      );
}
export default Overview;
